import React, { useState } from "react";

const Log = () => {
  const [username, setUsername] = useState();

  return (
    <>
      <div className="log-in">
        <input
          type="text"
          placeholder="Enter Username"
          value=""
          className="user-name"
        ></input>
        <input
          type="text"
          placeholder="Enter Password"
          value=""
          className="pass-word"
        ></input>
          <button onClick={null} className="sign-in">Sign In</button>
      </div>

    </>
  );
};

export default Log;
